import React, {useState} from "react";

import {Navigate} from "react-router-dom";
import {connect} from "react-redux";
import { Image } from "react-bootstrap";

import { login } from "../../actions/auth";

import "./Login.css"
import facebook from "./images/facebook.svg";
import google from "./images/google.svg";
import github from "./images/github.svg";
import line1 from "./images/line-1.svg";

const Login = ({ login, isAuthenticated }) => {
    const [formData, setFormData] = useState({
        email: '',
        password: '' 
    });

    const {email, password} = formData;

    const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

    const onSubmit = e => {
        e.preventDefault();

        login(email, password);
    };

    //If the user authenticated
    //Redirect to the home page

    if (isAuthenticated) {
        return <Navigate to="/" />
    }

    return (
        <div className="auth">
            <div className="div-3">
                <div className="overlap-10">
                    <div className="text-wrapper-10">Chào mừng bạn!</div>
                    <div className="frame-10">
                        <p className="code-learn-10">
                            <span className="span-10">Code</span>
                            <span className="text-wrapper-11">Learn</span>
                        </p>
                    </div>
                </div>

            <div className="ellipse-10" />
                <div className="overlap-group-10">
                    <div className="ellipse-11" />
                        <div className="frame-wrapper-10">
                            <div className="frame-12">
                                <div className="frame-13">
                                    <div className="upper-section-10">
                                        <div className="auth-text-10">
                                            <div className="text-wrapper-13">Đăng nhập</div>
                                            <div className="text-wrapper-14">Chào mừng bạn đã quay trở lại</div>
                                        </div>
                                    <div className="credentials">
                                        <form onSubmit={e=>onSubmit(e)}>
                                            <div className="form-group email">
                                                <input type="email-10" className="form-control-10" placeholder="Email" name="email" value={email} onChange={e=>onChange(e)} required/>
                                            </div>
                                            <div className="form-group passwd">
                                                <input type="password" className="form-control-10" placeholder="Mật khẩu" name="password" value={password} onChange={e=>onChange(e)} minlength="6" required/>
                                            </div>
                                            <div className="form-group-10 rememberMe mb-3">
                                                <input type="checkbox" id="rememberMe"/>
                                                <label className="text">Nhớ mật khẩu</label>
                                            </div>
                                            <button class="btn auth-bt-fp div-wrapper" type="submit">
                                                <p className="text-wrapper-15">Đăng nhập</p>
                                            </button>
                                        </form>
                                    </div>

                                    <a className="text-wrapper-16" href='/reset_password'> Quên mật khẩu?</a>
                                </div>
                            </div>
                            <div className="other-auths-10">
                                <div className="or-10">
                                    <Image className="line-10" alt="Line" src={line1} />
                                    <div className="text-wrapper-18">Hoặc</div>
                                    <Image className="line-10" alt="Line" src={line1} />
                                </div>
                                <div className="social-10">
                                    <a href = "https://mail.google.com/mail/u/0/?tab=rm&ogbl#inbox">
                                    <Image className="frame-14" alt="google" src={google} href ="https://mail.google.com/mail/u/0/?tab=rm&ogbl#inbox"/>
                                    </a>
                                    <a href = "https://www.facebook.com/">
                                    <Image className="frame-4" alt="facebook" src={facebook} />
                                    </a>
                                    <a href = "https://github.com/">
                                    <Image className="frame-4" alt="github" src={github} />
                                    </a>
                                </div>

                            </div>
                        </div>
                    <div className="frame-5">
                        <p className="don-t-have-an">
                            <span className="text-wrapper-9">Don't have an account?</span>
                            <span> 
                                <a className="text-wrapper-10" href="/signup"> Sign up</a>
                            </span>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    </div>
    );
};

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps,{ login }) (Login);
